import React from 'react'
import './Portfolio.css'
import {swiper,SwiperSlide,swiperslide}from 'swiper/react'

const Portfolio = () => {
  return (
    <div className="portfolio">
      {/* heading */}
      <span>Recent Projects</span>
      <span>Portfolio</span>

      {/* slider */}
      <swiper>
        <SwiperSlide>
          <img src="" alt="" />
        </SwiperSlide>
      </swiper>
    </div>
  )
}

export default Portfolio
